class Queue:
    def __init__(self) -> None:
        """
        Constructeur de la classe Queue
        args:
            Pas d'arguments
        return:
            Ne retourne rien, c'est un constructeur
        """
        self.l = []

    def file_vide(self) -> bool:
        """
        Permet de savoir si une file est vide
        args:
            Pas d'arguments
        return:
            Retourne un booléen, True si la file est vide, False si ce n'est pas le cas
        """
        return self.l == []

    def ajout(self,value) -> None:
        """
        Permet d'ajouter un élément à la fin de la file
        args:
            value: la valeur qu'on veut ajouter à la fin de la file
        return:
            Ne retourne rien, modifie seulement la liste de la classe
        """
        self.l.insert(0, value)

    def retire(self):
        """
        Permet de retirer le premier élément insérer dans la file et de l'avoir
        args:
            Pas d'arguments
        return:
            Retourne le premier élément ajouter dans la file
        """
        r = self.l[len(self.l) - 1]
        del(self.l[len(self.l) - 1])
        return r
    
    def premier(self):
        """
        Permet d'avoir le premier élément ajouter dans la file sans la modifier
        args:
            Pas d'arguments
        return:
            Retpurne le premier élément ajouter dans la file
        """
        return self.l[len(self.l) - 1]
    
